  `zjAmount` double(12,4) NOT NULL DEFAULT '0.0000' COMMENT '中奖金额',
  `fanDianAmount` double(12,4) NOT NULL DEFAULT '0.0000' COMMENT '返点金额',
  PRIMARY KEY (`id`),
  UNIQUE KEY `type` (`type`,`number`),
  KEY `time` (`time`) USING BTREE,
  KEY `data` (`data`)
